import React from 'react';

function Header() {
  const headerStyle = {
    display: 'flex',
    alignItems: 'center',
    height: 'fit-content',
    marginTop: '2vh',
    marginBottom: '-40px',
    justifyContent: 'center',
    backgroundColor: '#88c9bf'
  };

  const logoStyle = {
    borderRadius: '50%'
  };

  const headerTextStyle = {
    color: '#000000',
    fontFamily: 'Times New Roman, Times, serif',
    fontWeight: 200
  };

  const logoLeftRightStyle = {
    width: '100px',
    height: 'auto'
  };

  const headerTextContainerStyle = {
    flex: 1,
    textAlign: 'center',
    color: '#000000'
  };

  const mainContentStyle = {
    padding: '20px'
  };

  const mainImageStyle = {
    maxWidth: '100%',
    height: 'auto'
  };

  return (
    <div style={headerStyle}>
      <header>
        <img src="https://itai.escet.online/SCETLogo.jpg" alt="Left-Logo" style={{ ...logoStyle, ...logoLeftRightStyle }} />
        <div style={headerTextContainerStyle}>
          <h1 style={headerTextStyle}>A.I.D.S. DEPARTMENT</h1>
          <h2 style={headerTextStyle}>P.R. KHATIWALA CHARITABLE TRUST</h2>
        </div>
        <img src="https://itai.escet.online/SULogo.jpg" alt="Right-Logo" style={{ ...logoStyle, ...logoLeftRightStyle }} />
      </header>
      <div className="main-content" style={mainContentStyle}>
        <img src="main-image.jpg" alt="Main-Image" style={mainImageStyle} />
      </div>
    </div>
  );
}

export default Header;
